import React, { useState } from 'react';


const hardwareAssets = [
  {
    SN: 1,
    InventoryNo: '10B1D6300083',
    AssetType: 'SERVER WORK STATION',
    AssetDescription: 'Fujitsu RX300 S8 Server,',
    Location: '5Q2 SERVER ROOM'
  },
  {
    SN: 2,
    InventoryNo: '10B1D6300091',
    AssetType: 'SERVER WORK STATION',
    AssetDescription: 'Dell PowerEdge R730',
    Location: '5Q2 SERVER ROOM'
  },
  {
    SN: 3,
    InventoryNo: '10B1D6300092',
    AssetType: 'SERVER WORK STATION',
    AssetDescription: 'Dell PowerEdge R940',
    Location: '5Q2 SERVER ROOM'
  },
  {
    SN: 4,
    InventoryNo: '10B1D6300093',
    AssetType: 'SERVER WORK STATION',
    AssetDescription: 'Dell PowerEdge R940',
    Location: '5Q2 SERVER ROOM'
  },
  {
    SN: 5,
    InventoryNo: '10B1D6300094',
    AssetType: 'SERVER WORK STATION',
    AssetDescription: 'Dell PowerEdge R740',
    Location: '5Q2 SERVER ROOM'
  },
  // ... Add more hardware assets as needed
];

const contracts = [
  {
    SN: 1,
    ContractNo: '9010031884',
    Items: 'AMC OF 5 servers',
    Contractor: 'CYGNUS INFORMATION SOLUTIONS PVT LTD.',
    From: '14.11.2023',
    To: '13.11.2027',
    ContactDetails: 'techsupport@cygnussolutions.co.in Mob: 7715963567'
  },
  
  // ... Add more contracts as needed
];

const Assets = () => {
  const [activeTab, setActiveTab] = useState('hardware');
  const [searchTerm, setSearchTerm] = useState('');

  const filteredHardware = hardwareAssets.filter(asset =>
    Object.values(asset).some(value => 
      value.toString().toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  const filteredContracts = contracts.filter(contract =>
    Object.values(contract).some(value => 
      value.toString().toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  return (
    <div className="bg-gray-100 p-6 font-sans">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">Assets Dashboard</h1>
      <div className="mb-6">
        <button
          className={`px-4 py-2 mr-2 ${activeTab === 'hardware' ? 'bg-red-600 text-white' : 'bg-gray-300 text-gray-800'}`}
          onClick={() => setActiveTab('hardware')}
        >
          Hardware Assets
        </button>
        <button
          className={`px-4 py-2 ${activeTab === 'contracts' ? 'bg-red-600 text-white' : 'bg-gray-300 text-gray-800'}`}
          onClick={() => setActiveTab('contracts')}
        >
          Contracts
        </button>
      </div>
      <input 
        type="text" 
        placeholder="Search..." 
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        className="w-full p-2 mb-6 border border-gray-300 rounded"
      />
      {activeTab === 'hardware' && (
        <div className="overflow-x-auto">
          <table className="w-full bg-white shadow-md rounded">
            <thead>
              <tr className="bg-gray-800 text-white">
                <th className="px-4 py-2 text-left">SN</th>
                <th className="px-4 py-2 text-left">Inventory No</th>
                <th className="px-4 py-2 text-left">Asset Type</th>
                <th className="px-4 py-2 text-left">Asset Description</th>
                <th className="px-4 py-2 text-left">Location</th>
              </tr>
            </thead>
            <tbody>
              {filteredHardware.map((asset, index) => (
                <tr key={index} className="hover:bg-gray-100">
                  <td className="border px-4 py-2">{asset.SN}</td>
                  <td className="border px-4 py-2">{asset.InventoryNo}</td>
                  <td className="border px-4 py-2">{asset.AssetType}</td>
                  <td className="border px-4 py-2">{asset.AssetDescription}</td>
                  <td className="border px-4 py-2">{asset.Location}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
      {activeTab === 'contracts' && (
        <div className="overflow-x-auto">
          <table className="w-full bg-white shadow-md rounded">
            <thead>
              <tr className="bg-gray-800 text-white">
                <th className="px-4 py-2 text-left">SN</th>
                <th className="px-4 py-2 text-left">Contract No.</th>
                <th className="px-4 py-2 text-left">Items/Equipment</th>
                <th className="px-4 py-2 text-left">Contractor</th>
                <th className="px-4 py-2 text-left">From</th>
                <th className="px-4 py-2 text-left">To</th>
                <th className="px-4 py-2 text-left">Contact Details</th>
              </tr>
            </thead>
            <tbody>
              {filteredContracts.map((contract, index) => (
                <tr key={index} className="hover:bg-gray-100">
                  <td className="border px-4 py-2">{contract.SN}</td>
                  <td className="border px-4 py-2">{contract.ContractNo}</td>
                  <td className="border px-4 py-2">{contract.Items}</td>
                  <td className="border px-4 py-2">{contract.Contractor}</td>
                  <td className="border px-4 py-2">{contract.From}</td>
                  <td className="border px-4 py-2">{contract.To}</td>
                  <td className="border px-4 py-2">{contract.ContactDetails}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default Assets;
